(319, 'CONTACT D.RAULIN', 'CRDP', '', '', '', '', '', '', 'Message adressé le 20/05/08\r\nBonjour,\r\nJe reviens vers vous sur la question de l''atelier "ressources" des\r\nRencontres TICE. Le site est maintenant en ligne et le module de\r\npré-inscription bientôt opérationnel. Une première campagne\r\nd''information sera lancée début juin pour pouvoir définir une première\r\nliste de participants et recueillir les inscriptions aux ateliers en\r\nparticulier (aspect logistique très important). Pourriez-vous nous\r\nproposer pour la fin mai , ou avant, le descriptif de votre atelier\r\nainsi que la liste des participants pressentis (présents ou à distance)\r\n? Il est en effet indispensable que ces informations figurent au\r\nprogramme au moment de la communication vers la participants potentiels.\r\n\r\nPar ailleurs comme je vous l''avais indiqué dans un précédent\r\ncourriel, il est nécessaire que nous prenions prendre contact avec la personne qui\r\ns''occupe de l''affiche. Pourriez-vous nous communiquer ses coordonnées ?\r\nAvec mes remerciements\r\n\r\n', 0, '0000-00-00', NULL, '', 0, 0, 0, 0, 0, 0, 0, 0, 'MONTROL', 'public', 'France', NULL, NULL, NULL, NULL, NULL, NULL),
